  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer is an Arc/INFO grid map
  of land cover characteristics for North America, excluding Hawaii, and including
  the Caribbean and most of Mexico. The nominal spatial resolution is 1 km and the
  map layer is based on 1-km AVHRR data. The data were compiled by staff at the National
  Center for Earth Resources Observation and Science as part of the Global Land Cover
  Characterization Project. The land cover classes were produced using 1-km AVHRR
  data from April 1992 to March 1993. Documentation and the original data are available
  at http://edcsns17.cr.usgs.gov/glcc/. The data available through the National Atlas
  of the United States are in GeoTIFF format. This is a revised version of the May
  2002 map layer, with a corrected shoreline for Greenland.\",\n\t\"license_title\":
